import React, { useEffect } from 'react';
import '../assets/styles/home.css'; // Import the CSS file for styling
import Header from './Header';
import { useNavigate } from 'react-router-dom';

export const Home = () => {

  useEffect(() => {
    const navigate = useNavigate();
    if(sessionStorage.getItem("loginToken") === null) {
      navigate('/');
    }
  }, []);

  return (
    <div className="home-container">
      {/* Navbar Section */}
      <Header />

      {/* Welcome Heading */}
      <div className="welcome-section">
        <h1 className="welcome-heading">Welcome to EZPay</h1>
      </div>

      {/* Authors Heading */}
      <div className="authors-heading">
        <h2>Authors</h2>
      </div>

      {/* Author Sections */}
      <div className="author-sections">
        <div className="author-section">
          <h3>Akhil Kohila</h3>
          <p>Here Akhil</p>
        </div>
        <div className="author-section">
          <h3>Anurag Gulati</h3>
          <p>Here Anurag.</p>
        </div>
        <div className="author-section">
          <h3>Doneela Das</h3>
          <p>Here Doneela.</p>
        </div>
        <div className="author-section">
          <h3>Geethapriya Thandavmurthi</h3>
          <p>Here Geethapriya</p>
        </div>
        <div className="author-section">
          <h3>Jai Singh</h3>
          <p>Here Jai.</p>
        </div>
      </div>
    </div>
  );
};
